window.addEventListener("DOMContentLoaded",e=>{!function(){const e=document.querySelectorAll(".mdp-selection-grid"),t=window.innerWidth>1280;for(const n of e){const e=n.querySelectorAll(".mdp-selection-widget"),o=e.length/3-Math.floor(e.length/3)>.65;if(t&&o){const e=document.createElement("div");e.className="mdp-selection-widget mdp-empty",n.appendChild(e)}}}()});